# Run time is in seconds
def test_speed(func, run_time):
    execs = 0 # Num of excecutions
    
    time_start = process_time()
    while process_time() < time_start + run_time:
        # The bitwise & operator prevents accessing a number past the array length
        func(X_COORDS[execs & 8192], Y_COORDS[execs & 8192], Z_COORDS[execs & 8192])
        execs += 1
    return [execs, process_time() - time_start] # Num of excecutions, time elapsed

# Noise algorithms
def perlin_2D(x, y, _z):
    pnoise2(x, y)

def perlin_3D(x, y, z):
    pnoise3(x, y, z)

def simplex_2D(x, y, _z):
    snoise2(x, y)

def simplex_3D(x, y, z):
    snoise3(x, y, z)


functions = [perlin_2D, perlin_3D, simplex_2D, simplex_3D]
# Example format: [Func1[10Sec[64, 10.0054], 1Min[384, 60.0015] ...] ...]
test_results = []

if __name__ == '__main__':
    for f in functions:
        test = []

        test.append(test_speed(f, 10)) # 10 Seconds
        test.append(test_speed(f, 60)) # 1 Minute
        test.append(test_speed(f, 300)) # 5 Minutes

        test_results.append(test)

    print(test_results)
